import React from "react";
import Foto from "../imagenes/FotoPerfil.jpg";
import Info from "../imagenes/Info.png";

export default class MainCuenta extends React.Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col my-5 py-5">
            <div className="d-flex justify-content-center">
              <img
                src={Foto}
                alt="Foto de Perfil"
                className="rounded-circle"
                width="150"
              />
            </div>
            <div className="navbar text-white" ><img src={Info} alt="info" />Nuevo Test</div>
            <div className="navbar text-white" ><img src={Info} alt="info" />Resultados Anteriores</div>
            <div className="navbar text-white" ><img src={Info} alt="info" />Información de la Cuenta</div>
            <div className="navbar text-white" ><img src={Info} alt="info" />Configuración</div>
          </div>
        </div>
      </div>
    );
  }
}
